import React from 'react';
import {BrowserRouter, Routes, Route, useNavigate} from 'react-router-dom';

import Login from './Component/Login';
import Register from './Component/Register';
import Sidebar, {showSidebar} from './Component/Sidebar';
import CardAC from './Component/CardAC';
import Profile from './Component/Profile';
import ViewClubs from './Component/ViewClubs';
import ViewClubSingle from './Component/ViewClubSingle';
import Settings from './Component/Settings';
import Signout from './Component/Signout';


function App() {
  var url = "http://localhost:3001";
  const navigate = useNavigate();
  return(
    <BrowserRouter>
        <Routes>
          <Route path = "/" element = {<Login />} />
          <Route path = "/register" element = {<Register />} />
          <Route path = "/home" element= {<Sidebar />} >
            <IndexRoute element={<CardAC/>} />
            <Route path = "/profile" element= {<Profile />} />
            <Route path = "/vclubs" element= {<ViewClubs />} />
            <Route path = "/vclubs/:id" element= {<ViewClubSingle />} />
            <Route path = "/settings" element= {<Settings />} />
            <Route path = "/signout" element= {<Signout />} />
          </Route>
        </Routes>
    </BrowserRouter>
  );
}


export default App;
